var pong = '';

var instruction = '';
var pong2 = []; // Make groups of 2 bytes
for (var i = 0; i < pong.length + 1; i++) {
    if (i % 4 == 0 && i > 0) {
        pong2.push(parseInt(instruction, 16))
        instruction = '';
    }
    if (i < pong.length)
        instruction += pong.charAt(i);
}

VM.code = pong2;
VM.canvas = document.getElementById('game_canvas');

run(VM);
